import React from "react";
import { Form, Label, Input, FormGroup } from "reactstrap";

function CreatePost() {
  return (
    <>
      <Form style={{ width: "" , marginTop: "50px" }}>
        <FormGroup>
          <Label for="title">Title</Label>
          <Input id="exampleEmail" name="title" placeholder="enter your tittle" type="input"/>
        </FormGroup>
        <FormGroup>
          <Label for="Discription">Discription</Label>
          <Input id="Discription" placeholder="write your description" name="Discription" type="textarea"/>
        </FormGroup>
      </Form>
    </>
  );
}

export default CreatePost;
